import React from "react";
import styled from "styled-components"; 


const Card = (props)=>{
    return (
        <div>
            <p> {props.nome}</p>
            <p> {props.descricao}</p>
            <p> {props.duracao}</p>
            <p> {props.data}</p>
            <p> {props.nome}</p>
        </div>
    )
}

export default Card;
